Thrilled my work is currently shown @thewrong.biennale ;  an independent, multicultural, decentralized and collaborative international art biennial.

The curated show @cake.wunderkammer is a digital cabinet of curious cakes situated on Instagram, thus accessible to everyone, everywhere at any time. It explores the essence of cake, its boundaries, its voice, and its place in our world. Curated by @nomi_abeliovich

